/**css reset**/
* {
    box-sizing: border-box;
}

*:before,
*:after {
    box-sizing: border-box;
}

* {
    margin: 0;
    padding: 0;
}

ul,
ol {
    list-style: none;
}

a {
    color: inherit;
    text-decoration: none;
}

body {
    background: #eee;
}

.globalHeader {
    margin: 40px 20px 20px 20px;


}

form {
    display: flex;
    justify-content: space-between;

}

input {
    width: 100%;
    margin-right: 10px;
    padding: 0 10px;
    border: 1px solid #ddd;
    border-radius: 4px;
}

button {
    white-space: nowrap;
    padding: 10px;
    border: none;
    border-radius: 4px;
}
